(79, 'widget_text', 'a:4:{i:2;a:3:{s:5:\"title\";s:21:\"Thông tin liên hệ\";s:4:\"text\";s:203:\"Công ty TNHH Aqua-Pura Việt Nam\r\n\r\nTrụ sở chính: Số 268 Mai anh Tuấn - Đống Đa - Hà Nội\r\n\r\nĐiện thoại: 0906 55 67 69\r\n\r\nEmail: aquapuravn@gmail.com\r\n\r\nWebsite: www.aquapura.com.vn\";s:6:\"filter\";s:7:\"content\";}i:3;a:4:{s:5:\"title\";s:21:\"Thông tin liên hệ\";s:4:\"text\";s:1452:\"<i class=\"fa fa-windows\" aria-hidden=\"true\"></i><strong>CÔNG TY CỔ PHẦN DẦU KHÍ QUỐC TẾ NAM VIỆT</strong>\r\n\r\n<i class=\"fa fa-home\" aria-hidden=\"true\"></i><strong>Văn phòng giao dịch : Tầng 2b, số nhà 12C, km 14/500 , quốc lộ 6, Phú Lãm Hà Đông, Hà Nội</strong>.\r\n\r\n<i class=\"fa fa-home\" aria-hidden=\"true\"></i><strong>Địa chỉ : Nhóm 7 - Đông Viên - Xã Đông Quang - Ba Vì - Hà Nội</strong>.\r\n\r\n<i class=\"fa fa-home\" aria-hidden=\"true\"></i>Nhà máy Hà Nội: KCN Biên Giang, Yên Thành, Hà Đông, Hà Nội\r\n\r\n<i class=\"fa fa-home\" aria-hidden=\"true\"></i>Nhà máy Thanh Hóa: QL1, Hoằng Phú, Hoằng Hóa, Thanh Hóa\r\n\r\n<i class=\"fa fa-home\" aria-hidden=\"true\"></i>Nhà máy Nghệ An: QL1, Nghi Liên, TP. Vinh.\r\n\r\n<i class=\"fa fa-home\" aria-hidden=\"true\"></i>Nhà máy Đà Nẵng: KĐT Phước Lý, Q. Liên Chiểu, TP Đà Nẵng.\r\n\r\n<i class=\"fa fa-home\" aria-hidden=\"true\"></i>Nhà máy Hồ Chí Minh: Số 51, Đ. TX 31, P. Thạnh Xuân, Q 12, TP. HCM\r\n\r\n<i class=\"fa fa-home\" aria-hidden=\"true\"></i>Nhà máy Cần Thơ: 254 Hoàng Quốc Việt, Phường An Bình, Q. Ninh Kiều, TP Cần Thơ.\r\n\r\n<i class=\"fa fa-phone\" aria-hidden=\"true\"></i><strong> Hotline: 0989130086 - 0936403966</strong>\r\n\r\n<i class=\"fa fa-envelope\" aria-hidden=\"true\"></i>Gmail: <a href=\"mailto:pdp.sondoyle@gmail.com\" target=\"_blank\" rel=\"noopener\">pdp.sondoyle@gmail.com</a>- Website: doylecolor.com\";s:6:\"filter\";b:1;s:6:\"visual\";b:1;}i:4;a:4:{s:5:\"title\";s:21:\"Đăng ký nhận tin\";s:4:\"text\";s:61:\"[contact-form-7 id=\"136\" title=\"Đăng ký email nhận tin\"]\";s:6:\"filter\";