(2, 1, '2017-06-15 04:20:37', '2017-06-14 21:20:37', '<h1><strong>Công ty Cổ phần Nam Việt.Group - Nam Việt Group - Hãng Sơn Ronin</strong></h1>\r\n<h2><strong>LỜI GIỚI THIỆU</strong><strong> </strong></h2>\r\nCông ty chúng tôi xác định Việt Nam là thị trường giàu tiềm năng và là nền tảng để phát triển mặt hàng sơn nước. Trong năm 2006,<strong> Công ty Cổ phần Nam Việt.Group - Nam Việt Group</strong> đã đầu tư dây chuyền công nghệ hiện đại với công suất sản xuất 2 triệu lít sơn và hàng ngàn tấn bột trét mỗi năm, kinh phí đầu tư trên 2triệu USD tại Khu Công Nghiệp Thanh Oai, Hà Nội đây là một trong những nhà máy sản xuất sơn lớn nhất Việt Nam hiện nay. <a href=\"http://sinhvienkinhtetphcm.com/hoc-xuat-nhap-khau-o-dau-tot-nhat-tphcm-va-ha-noi.html\"><span style=\"color: #ffffff;\">ký hậu vận đơn để làm gì</span></a>\r\n\r\nVề nguyên liệu sản xuất, áp dụng nguyên tắc kiểm tra đầu vào nghiêm ngặt, hầu hết nguyên liệu sản xuất <strong>sơn DOYLE </strong>nhập khẩu từ những tập đoàn hóa chất nổi tiếng như: Degussa (Mỹ), Eliokem (Pháp), Dow Chemical (Mỹ), Rohm &amp; Hass (Mỹ), Cray Valley (Maylaysia), Nuplex (Australia)...\r\n\r\nVề mặt kỹ thuật, với dây chuyền công nghệ hiện đại cùng đội ngũ chuyên gia kỹ thuật giàu kinh nghiệm tiến hành nghiên cứu, phát triển sản phẩm, song song đó công ty đã tiến hành hợp tác kỹ thuật, mua các phát minh mới từ nước ngoài, chủ yếu là Nhật và châu Á kết hợp với nghiên cứu, cải tiến nhằm đưa ra sản phẩm chất lượng cao, phù hợp với môi trường khí hậu Việt Nam.\r\n\r\nHơn nữa, việc tích hợp hệ thống quản lý môi trường theo tiêu chuẩn ISO 14001:2004, và hệ thống quản lý chất lượng theo tiêu chuẩn ISO 9001:2008, được công nhận bởi Tổ chức của Nhật, đã khẳng định rằng <strong>Công ty Cổ phần Nam Việt.Group - Nam Việt Group</strong> đã đề ra chính sách phù hợp và cũng định hướng cho việc cải tiến liên tục các sản phẩm, đáp ứng nhu cầu càng cao về sản phẩm sơn trang trí của thị trường trong nước.\r\n\r\nChính vì thế, <strong>sơn DOYLE</strong> do <strong>Công ty Cổ phần Nam Việt.Group - Nam Việt Group </strong>sản xuất luôn được giới chuyên môn, kiến trúc sư, kỹ sư, thầu thợ chuyên nghiệp sử dụng và đánh giá cao. Ngoài ra Công ty  đã và đang rất thành công và đầu tư phát triển trong việc tham gia đấu thầu thi công và cung cấp vật liệu cho các dự án lớn trong cả    nước.\r\n<strong>Công ty Cổ phần Nam Việt.Group - Nam Việt Group</strong> luôn phấn đấu là địa chỉ đáng tin cậy của các nhà thầu xây dựng tại Việt Nam và mong muốn nhận được sự hợp tác của bạn hàng trong nước và quốc tế.\r\n\r\nTrân trọng cảm ơn!\r\n\r\n<strong>Công ty Cổ phần Nam Việt.Group - Nam Việt Group</strong>', 'Giới thiệu', '', 'publish', 'closed', 'closed', '', 'gioi-thieu', '', '', '2018-06-04 11:57:29', '2018-06-04 04:57:29', '', 0, 'http://raothue.ddns.net/demo/rt-core/?page_id=2', 0, 'page', '', 0),
(5, 1, '2017-06-15 04:22:29', '2017-06-15 04:22:29', 'Đây là một trang mẫu. Nó khác với một bài blog bởi vì nó sẽ là một trang tĩnh và sẽ được thêm vào thanh menu của trang web của bạn (trong hầu hết theme). Mọi người thường bắt đầu bằng một trang Giới thiệu để giới thiệu bản thân đến người dùng tiềm năng. Bạn có thể viết như sau:\r\n<blockquote>Xin chào! Tôi là người giao thư bằng xe đạp vào ban ngày, một diễn viên đầy tham vọng vào ban đêm, và đây là trang web của tôi. Tôi sống ở Los Angeles, có một chú cho tuyệt vời tên là Jack, và tôi thích uống cocktail.</blockquote>\r\n...hay như thế này:\r\n<blockquote>Công ty XYZ Doohickey được thành lập vào năm 1971, và đã cung cấp đồ dùng chất lượng cho công chúng kể từ đó. Nằm ở thành phố Gotham, XYZ tạo việc làm cho hơn 2.000 người và làm tất cả những điều tuyệt vời cho cộng đồng Gotham.</blockquote>\r\nLà người dùng WordPress mới, bạn nên truy cập <a href=\"http://raothue.ddns.net/demo/rt-core/wp-admin/\">trang quản trị</a> để xóa trang này và tạo các trang mới cho nội dung của bạn. Chúc vui vẻ!', 'Trang Mẫu', '', 'inherit', 'closed', 'closed', '', '2-revision-v1', '', '', '2017-06-15 04:22:29', '2017-06-15 04:22:29', '', 2, 'http://raothue.ddns.net/demo/rt-core/2-revision-v1/', 0, 'revision', '', 0),
