(177, 1, '2017-11-01 15:13:50', '2017-11-01 08:13:50', '<strong><em>1. Mô tả:</em></strong>\r\n\r\nDOYLE DO6.7 là hệ sơn chống thấm dạng lỏng, hệ nước, nhũ tương màu trắng sữa.\r\n\r\nDOYLE DO6.7 là loại sơn acrylic biến tính tương thích với hệ trộn xi măng. Khi phủ lên lớp bề mặt bên trong hoặc bên ngoài các công trình xây dựng, sơn tạo thành lớp màng cứng kín nước, xong bề mặt vẫn thoát hơi nước một cách dễ dàng.\r\n\r\n<img class=\"aligncenter wp-image-178 size-large\" src=\"http://doylecolor.com/wp-content/uploads/2017/11/DOYLE-DO6.7-1024x778.jpg\" alt=\"\" width=\"1000\" height=\"760\" />\r\n\r\n&nbsp;\r\n\r\n<strong><em>2. Công dụng:</em></strong>\r\n<ul>\r\n 	<li>DOYLE là loại sơn chống thấm được sử dụng tốt nhất để ngăn thấm nước cho các bề mặt vữa chát, xi măng bê tông như: tường đứng, trần nhà, sàn nhà vệ sinh, bể nước… Với các đặc tính nổi bật như sau:\r\n<ul>\r\n 	<li>Chống thấm tuyệt đối cho các bề mặt ứng dụng.</li>\r\n 	<li>Độ liên kết và kết dính tuyệt hảo.</li>\r\n 	<li>Giảm tối đa sự co ngót thể tích trong quá trình đóng rắn xi măng.</li>\r\n 	<li>Tăng tính co dãn, độ đàn hồi cho vữa xi măng – cát.</li>\r\n 	<li>Tăng tính kháng ăn mòn hoá học, kháng mài mòn cơ học. Ổn định về mặt hoá, lý tính.</li>\r\n 	<li>Không cháy, không chứa chì và thuỷ ngân, không gây độc hại cho người sử dụng và người thi công, nên có thể sử dụng cho các lớp vữa chống thấm tiếp xúc trực tiếp với nước sinh hoạt.</li>\r\n</ul>\r\n</li>\r\n</ul>\r\n<strong><em>3. Thông số kỹ thuật:</em></strong>\r\n\r\n– Nguồn gốc hoá học: keo chống thấm acrylic biến tính và phụ gia.\r\n\r\nKhối lượng riêng: 1.25 ± 0.05 (g/ml, @ 25 oC); pH = 8 – 10.\r\n<ul>\r\n 	<li>Điều kiện lưu trữ: Bảo quản nơi khô ráo, thoáng mát, tránh tiếp xúc trực tiếp với ánh nắng. Đậy kín khi sử dụng còn dư và chưa trộn với xi măng.</li>\r\n 	<li>Thời gian lưu trữ: 12 tháng kể từ ngày sản xuất (trong thùng nguyên, bảo quản đúng).</li>\r\n 	<li>Đóng gói: 1kg, 5kg, 20kg/thùng <em>(Khối lượng cả bao bì)</em></li>\r\n</ul>\r\n<strong><em>4. Thi công:</em></strong>\r\n<ul>\r\n 	<li>Chuẩn bị bề mặt: Bề mặt bê tông phải được làm ẩm và làm sạch, ở điều kiện không dính dầu mỡ, bụi xi măng và các tạp chất khác. Nếu bề mặt có độ nhám thấp cần phải tạo nhám băng các biện pháp cơ học thích hợp trước khi ứng dụng sản phẩm.</li>\r\n 	<li>Thi công: Chuẩn bị sơn chống thấm DO6.7 – DOYLE và xi măng Poorter mác cao (từ 400 trở lên) theo tỷ lệ 1:1. Pha xi măng với một lượng nước sạch thành dạng sền sệt, sau đó pha với DO6.7 – DOYLE và khuấy lại thật đều. Dùng chổi cọ hoặc rulô phủ 2-3 lớp hỗn hợp trên lên bề mặt sử dụng, mỗi lớp sơn cách nhau 06 – 08 giờ. DO6.7 – DOYLE sau khi sơn xong từ 1-2 ngày thì mới tiến hành sơn phủ các lớp sơn khác lên. DO6.7 – DOYLE sẽ cứng lại sau 7 ngày.</li>\r\n 	<li>Chú ý: Nếu đã trộn DO6.7 – DOYLE với xi măng thì phải sử dụng trong vòng 1 giờ. Vì sau thời gian đó sản phẩm sẽ bị đông cứng. Sử dụng đến đâu thì trộn xi măng đến đó.</li>\r\n 	<li>Định mức: 3.0 – 3.5 m<sup>2 </sup>/1kg, tuỳ thuộc bề mặt vật liệu</li>\r\n 	<li>Vệ sinh dụng cụ: Rửa bằng xà bông và nước sạch.</li>\r\n</ul>\r\n<p style=\"text-align: center;\"><span style=\"color: #ff0000;\"><strong>CÔNG TY CỔ PHẦN DẦU KHÍ QUỐC TẾ NAM VIỆT</strong></span></p>\r\n<p style=\"text-align: center;\"><strong>Địa chỉ : Nhóm 7 - Đông Viên - Xã Đông Quang - Ba Vì - Hà Nội</strong></p>\r\n<p style=\"text-align: center;\"><span style=\"color: #ff0000;\"><strong>Hotline: 0989130086 – 0936403966</strong></span>\r\n<span style=\"color: #0000ff;\">Website: doylecolor.com- Email:dkqtnamviet@gmail.com</span>\r\n<strong>Nhà máy Hà Nội: KCN Biên Giang, Yên Thành, Hà Đông, Hà Nội</strong>\r\nNhà máy Thanh Hóa: QL1, Hoằng Phú, Hoằng Hóa, Thanh Hóa.\r\nNhà máy Nghệ An: QL1, Nghi Liên, TP. Vinh.\r\nNhà máy Đà Nẵng: KĐT Phước Lý, Q. Liên Chiểu, TP Đà Nẵng.\r\nNhà máy Hồ Chí Minh: Số 51, Đ. TX 31, P. Thạnh Xuân, Q 12, TP. HCM\r\nNhà máy Cần Thơ: 254 Hoàng Quốc Việt, Phường An Bình, Q. Ninh Kiều, TP Cần Thơ.</p>', 'DOYLE DO6.7 – SƠN CHỐNG THẤM ĐA NĂNG', '', 'publish', 'open', 'closed', '', 'doyle-do6-7-son-chong-tham-da-nang', '', '', '2017-11-07 11:02:44', '2017-11-07 04:02:44', '', 0, 'http://doylecolor.com/?post_type=product&#038;p=177', 0, 'product', '', 0),
