(179, 1, '2017-11-01 15:17:57', '2017-11-01 08:17:57', '<strong>Mô tả sản phẩm:</strong>\r\n\r\nDOYLE – PRIMER INT là sơn lót kháng kiềm nội thất cao cấp, là loại sơn được làm từ nhựa tổng hợp Acrylic. Đây là loại sơn có khả năng kháng kiềm cao, chống phồng rộp, chống bong tróc giữa sơn và bề mặt tường rất cao, có khả năng đàn hồi, giúp che lấp các khe nứt nhỏ như những vết chân chim.\r\n\r\n<img class=\"aligncenter size-large wp-image-180\" src=\"http://doylecolor.com/wp-content/uploads/2017/11/DOYLE-DO6.6NO-1024x778.jpg\" alt=\"\" width=\"1000\" height=\"760\" />\r\n\r\n&nbsp;\r\n\r\n<strong>Tính năng vượt trội:</strong>\r\n<ol>\r\n 	<li>Có độ chống kiềm cao, khả năng bám dính tốt,… bảo vệ lớp sơn phủ hoàn thiện luôn tươi mới và bền đẹp với thời gian.</li>\r\n 	<li>Có khả năng đàn hồi và che lấp các khe nứt nhỏ,… cho bề mặt sơn phủ luôn sáng bóng.</li>\r\n 	<li>Đã được nhiệt đới hóa phù hợp với điều kiện thời tiết khắc nghiệt của Việt Nam.</li>\r\n 	<li>Độ phủ cao – tiết kiệm chi phí trên từng m<sup>2</sup>.</li>\r\n 	<li>Thi công dễ dàng, thân thiện với môi trường.</li>\r\n 	<li>Phù hợp TCVN: 6934-2001</li>\r\n</ol>\r\n<strong>Thông số kỹ thuật:</strong>\r\n<table width=\"705\">\r\n<tbody>\r\n<tr>\r\n<td>Loại keo</td>\r\n<td>Độ mịn</td>\r\n<td>Độ phủ lý thuyết</td>\r\n<td>Độ nhớt</td>\r\n<td>Ngâm trong nước &amp; DD Ca(OH)2 bão hòa</td>\r\n</tr>\r\n<tr>\r\n<td>Acrylic</td>\r\n<td>30µm</td>\r\n<td>10-12m<sup>2</sup>/1lớp /1kg</td>\r\n<td>99KU±0.5%</td>\r\n<td>Màng phủ bền</td>\r\n</tr>\r\n<tr>\r\n<td>Tỷ trọng</td>\r\n<td>Hàm lượng chất rắn không bay hơi</td>\r\n<td>Thời gian khô bề mặt</td>\r\n<td>Thời gian khô hoàn toàn</td>\r\n<td>Pha loãng</td>\r\n</tr>\r\n<tr>\r\n<td>1.31</td>\r\n<td>48.8</td>\r\n<td>30 phút</td>\r\n<td>2 giờ</td>\r\n<td>Tối đa 10% nước sạch</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<strong> </strong>\r\n\r\n<strong>Thi công:</strong>\r\n<ol>\r\n 	<li>Chuẩn bị bề mặt: Bề mặt sơn phải được làm sạch, khô ráo, độ ẩm không quá 15%, không bị bẩn, không dính hóa chất, dầu mỡ, bị rỉ sắt, bong tróc, sử dụng chất tẩy rửa để làm sạch nếu cần. Sử dụng giấy nhám mịn để tạo bề mặt cần sơn được bóng loáng. Những vết nứt và lỗ thủng cần được vá lại trước khi thi công.</li>\r\n 	<li>Khuấy đều thùng sơn trước khi sử dụng. Dùng Runo, cọ lăn hay Máy phun sơn để thi công.</li>\r\n 	<li>Đổ sơn còn thừa vào thùng, làm sạch những nơi bị dính sơn bằng nước sạch ngay khi sơn xong.</li>\r\n</ol>\r\n<strong>Hệ thống sơn đề nghị:</strong>\r\n<table width=\"717\">\r\n<tbody>\r\n<tr>\r\n<td>Bột trét tường</td>\r\n<td>1-2 lớp</td>\r\n<td> Bột bả cao cấp DOYLE</td>\r\n</tr>\r\n<tr>\r\n<td>Sơn lót</td>\r\n<td>1-2 lớp</td>\r\n<td>Sơn lót kháng kiềm cao cấp DOYLE – PRIME. INT</td>\r\n</tr>\r\n<tr>\r\n<td rowspan=\"3\">Sơn phủ</td>\r\n<td rowspan=\"3\">2 lớp</td>\r\n<td>– Sơn phủ mờ DOYLE – IN FAMI</td>\r\n</tr>\r\n<tr>\r\n<td>– Sơn phủ bóng DOYLE– IN FLAT</td>\r\n</tr>\r\n<tr>\r\n<td>– Sơn siêu bóng DOYLE – GLOSS ONE</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p style=\"text-align: center;\"><span style=\"color: #ff0000;\"><strong>CÔNG TY CỔ PHẦN DẦU KHÍ QUỐC TẾ NAM VIỆT</strong></span></p>\r\n<p style=\"text-align: center;\"><strong>Địa chỉ : Nhóm 7 - Đông Viên - Xã Đông Quang - Ba Vì - Hà Nội</strong></p>\r\n<p style=\"text-align: center;\"><span style=\"color: #ff0000;\"><strong>Hotline: 0989130086 – 0936403966</strong></span>\r\n<span style=\"color: #0000ff;\">Website: doylecolor.com- Email:dkqtnamviet@gmail.com</span>\r\n<strong>Nhà máy Hà Nội: KCN Biên Giang, Yên Thành, Hà Đông, Hà Nội</strong>\r\nNhà máy Thanh Hóa: QL1, Hoằng Phú, Hoằng Hóa, Thanh Hóa.\r\nNhà máy Nghệ An: QL1, Nghi Liên, TP. Vinh.\r\nNhà máy Đà Nẵng: KĐT Phước Lý, Q. Liên Chiểu, TP Đà Nẵng.\r\nNhà máy Hồ Chí Minh: Số 51, Đ. TX 31, P. Thạnh Xuân, Q 12, TP. HCM\r\nNhà máy Cần Thơ: 254 Hoàng Quốc Việt, Phường An Bình, Q. Ninh Kiều, TP Cần Thơ.</p>', 'SƠN LÓT KHÁNG KIỀM NỘI THẤT CAO CẤP', '', 'publish', 'open', 'closed', '', 'son-lot-khang-kiem-noi-cao-cap', '', '', '2017