(181, 1, '2017-11-01 15:19:40', '2017-11-01 08:19:40', '<strong>Mô tả sản phẩm:</strong>\r\nDOYLE – PRIMER.EXT là sơn lót kháng kiềm ngoại thất cao cấp, là loại sơn được làm từ nhựa tổng hợp Acrylic. Đây là loại sơn có khả năng kháng kiềm cao, chống phồng rộp, chống bong tróc giữa sơn và bề mặt tường rất cao, có khả năng đàn hồi, giúp che lấp các khe nứt nhỏ như những vết chân chim\r\n\r\nĐóng gói: 5,7kg, 22kg /thùng (Khối lượng cả bao bì)\r\n\r\n<img class=\"aligncenter size-large wp-image-182\" src=\"http://doylecolor.com/wp-content/uploads/2017/11/DOYLE-DO6.6NG-1024x778.jpg\" alt=\"\" width=\"1000\" height=\"760\" />\r\n\r\n&nbsp;\r\n\r\n<strong>Tính năng vượt trội:</strong>\r\n\r\nCó độ chống kiềm cao, khả năng bám dính tốt,… bảo vệ lớp sơn phủ hoàn thiện luôn tươi mới và bền đẹp với thời gian.\r\nCó khả năng đàn hồi và che lấp các khe nứt nhỏ,… cho bề mặt sơn phủ luôn sáng bóng. <a href=\"https://vanbanketoan.com/hoc-ke-toan-thuc-hanh-tong-hop-o-dau-tot-nhat/\"><span style=\"color: #ffffff;\">vinatrain có tốt không</span></a>\r\nĐã được nhiệt đới hóa phù hợp với điều kiện thời tiết khắc nghiệt của Việt Nam.\r\nĐộ phủ cao – tiết kiệm chi phí trên từng m2.\r\nThi công dễ dàng, thân thiện với môi trường. <a href=\"https://kienthucxuatnhapkhau.com/hoc-xuat-nhap-khau-o-dau-tot-nhat-ha-noi-va-tphcm.html\"><span style=\"color: #ffffff;\">bieu thue xuat khau</span></a>\r\nPhù hợp TCVN: 6934-2001\r\n<strong>Thông số kỹ thuật:</strong>\r\n\r\nLoại keo Độ mịn Độ phủ lý thuyết Độ nhớt Ngâm trong nước &amp; DD Ca(OH)2 bão hòa\r\nAcrylic 30µm 10-12 m2/1lớp/1 kg 99 KU ± 0.5% Màng phủ bền\r\nTỷ trọng Hàm lượng chất rắn không bay hơi Thời gian khô bề mặt Thời gian khô hoàn toàn Pha loãng\r\n1.31 54.3 30 phút 2 giờ Tối đa 10% nước sạch\r\n\r\n<strong>Thi công:</strong>\r\n\r\nChuẩn bị bề mặt: Bề mặt sơn phải được làm sạch, khô ráo, độ ẩm không quá 15%, không bị bẩn, không dính hóa chất, dầu mỡ, bị rỉ sắt, bong tróc, sử dụng chất tẩy rửa để làm sạch nếu cần. Sử dụng giấy nhám mịn để tạo bề mặt cần sơn được bóng loáng. Những vết nứt và lỗ thủng cần được vá lại trước khi thi công.\r\nKhuấy đều thùng sơn trước khi sử dụng. Dùng Rulo, cọ lăn hay Máy phun sơn để thi công.\r\nĐổ sơn còn thừa vào thùng, làm sạch những nơi bị dính sơn bằng nước sạch ngay khi sơn xong.\r\n<strong>Hệ thống sơn đề nghị:</strong>\r\n\r\nBột trét tường 1-2 lớp Bột bả ngoại thất cao cấp DOYLE\r\nSơn lót 1-2 lớp Sơn lót kháng kiềm ngoại thất cao cấp DOYLE – PRIMER .EXT\r\nSơn phủ 2 lớp – Sơn phủ mờ ngoại thất DOYLE– GOLD.EXT\r\n– Sơn phủ bóng ngoại thất DOYLE – SATIN.EXT\r\n– Sơn siêu bong ngoại thất DOYLE – ALL IN ONE\r\n<p style=\"text-align: center;\"><span style=\"color: #ff0000;\"><strong>CÔNG TY CỔ PHẦN DẦU KHÍ QUỐC TẾ NAM VIỆT</strong></span></p>\r\n<p style=\"text-align: center;\"><strong>Địa chỉ : Nhóm 7 - Đông Viên - Xã Đông Quang - Ba Vì - Hà Nội</strong></p>\r\n<p style=\"text-align: center;\"><span style=\"color: #ff0000;\"><strong>Hotline: 0989130086 – 0936403966</strong></span>\r\n<span style=\"color: #0000ff;\">Website: doylecolor.com- Email:dkqtnamviet@gmail.com</span>\r\n<strong>Nhà máy Hà Nội: KCN Biên Giang, Yên Thành, Hà Đông, Hà Nội</strong>\r\nNhà máy Thanh Hóa: QL1, Hoằng Phú, Hoằng Hóa, Thanh Hóa.\r\nNhà máy Nghệ An: QL1, Nghi Liên, TP. Vinh.\r\nNhà máy Đà Nẵng: KĐT Phước Lý, Q. Liên Chiểu, TP Đà Nẵng.\r\nNhà máy Hồ Chí Minh: Số 51, Đ. TX 31, P. Thạnh Xuân, Q 12, TP. HCM\r\nNhà máy Cần Thơ: 254 Hoàng Quốc Việt, Phường An Bình, Q. Ninh Kiều, TP Cần Thơ.</p>', 'SƠN LÓT KHÁNG KIỀM NGOẠI THẤT – PRIMER EXT', '', 'publish', 'open', 'closed', '', 'son-lot-khang-kiem-ngoai-primer-ext', '', '', '2018-10-02 16:01:15', '2018-10-02 09:01:15', '', 0, 'http://doylecolor.com/?post_type=product&#038;p=181', 0, 'product', '', 0),
