(189, 1, '2017-11-01 16:33:31', '2017-11-01 09:33:31', '<table style=\"width: 796px;\">\r\n<tbody>\r\n<tr style=\"height: 274px;\">\r\n<td style=\"width: 467px; height: 274px;\"><strong>Mô tả sản phẩm: DOYLE</strong> – All in one  là sơn phủ ngoại thất cao cấp, là loại sơn được làm từ nhựa tổng hợp Acrylic. Đây là loại sơn có khả năng bám dính cao, chống phồng rộp, chống bong tróc giữa sơn  và bề mặt tường rất cao, có khả năng đàn hồi, giúp che lấp các khe nứt nhỏ như những vết chân chim. Rất phù hợp cho các công trình đòi hỏi chất lượng thượng hạng\r\n\r\nĐóng gói : 1kg, 5kg, 20kg/thùng (Khối lượng cả bao bì)</td>\r\n<td style=\"width: 315px; height: 274px;\"><img class=\"aligncenter size-large wp-image-191\" src=\"http://doylecolor.com/wp-content/uploads/2017/11/DOYLE-DO6.10NG-1024x778.jpg\" alt=\"\" width=\"1000\" height=\"760\" /></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<strong>Tính năng vượt trội:</strong>\r\n<ol>\r\n 	<li>Rất bóng. có khả năng bám dính rất tốt, luôn tươi mới, có khẳ năng tự làm sạch, trà rửa tối đa và bền đẹp với thời gian.</li>\r\n 	<li>Có khả năng đàn hồi và che lấp các khe nứt nhỏ … cho bề mặt sơn phủ luôn sáng bóng.</li>\r\n 	<li>Đã được nhiệt đới hóa phù hợp với điều kiện thời tiết khắc nhiệt của Việt Nam.</li>\r\n 	<li>Độ phủ cao – tiết kiệm chi phí trên từng m<sup>2</sup>. <a href=\"https://nghiepvuketoanthue.com/nen-hoc-ke-toan-tong-hop-thuc-hanh-o-dau-tai-ha-noi/\"><span style=\"color: #ffffff;\">vinatrain có tốt không</span></a></li>\r\n 	<li>Thi công dễ dàng, thân thiện với môi trường.</li>\r\n 	<li>Phù hợp TCVN: 6934-2001 <a href=\"http://sinhvienkinhtetphcm.com/hoc-xuat-nhap-khau-o-dau-tot-nhat-tphcm-va-ha-noi/\"><span style=\"color: #ffffff;\">bieu thue xuat khau</span></a></li>\r\n</ol>\r\n<strong>Thông số kỹ thuật:</strong>\r\n<table width=\"737\">\r\n<tbody>\r\n<tr>\r\n<td>Loại keo</td>\r\n<td>Độ mịn</td>\r\n<td>Độ phủ lý thuyết</td>\r\n<td>Độ nhớt</td>\r\n<td>Ngâm trong nước &amp; DD Ca(OH)2 bão hòa</td>\r\n</tr>\r\n<tr>\r\n<td>Acrylic</td>\r\n<td>25 µm</td>\r\n<td>10-12m<sup>2</sup>/1lớp /1kg</td>\r\n<td>99 KU ± 0.5%</td>\r\n<td>Màng phủ bền</td>\r\n</tr>\r\n<tr>\r\n<td>Tỷ trọng</td>\r\n<td>Hàm lượng chất rắn không bay hơi</td>\r\n<td>Thời gian khô bề mặt</td>\r\n<td>Thời gian khô hoàn toàn</td>\r\n<td>Pha loãng</td>\r\n</tr>\r\n<tr>\r\n<td>1.18</td>\r\n<td>52.4</td>\r\n<td>30 phút</td>\r\n<td>2 giờ</td>\r\n<td>Tối đa 10% nước sạch</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<strong> </strong><strong>Thi công:</strong>\r\n<ol>\r\n 	<li>Chuẩn bị bề mặt: Bề mặt sơn phải được làm sạch, khô ráo, độ ẩm không quá 15%, không bị bẩn, không dính hóa chất, dầu mỡ, bị rỉ sắt, bong tróc, sử dụng chất tẩy rửa để làm sạch nếu cần. Sử dụng giấy nhám mịn để tạo bề mặt cần sơn được bóng loáng. Nhứng vết nứt và lỗ thủng cần được vá lại trước khi thi công.</li>\r\n 	<li>Khuấy đều thùng sơn trước khi sử dụng. Dùng Rulo, cọ lăn hay Máy phun sơn để thi công.</li>\r\n 	<li>Đổ sơn còn thừa vào thùng, làm sạch những nơi bị dính sơn bằng nước sạch ngay khi sơn xong.</li>\r\n</ol>\r\n<strong>Hệ thống sơn đề nghị:</strong>\r\n<table width=\"714\">\r\n<tbody>\r\n<tr>\r\n<td>Bột trét tường</td>\r\n<td>1-2 lớp</td>\r\n<td> Bột bả ngoại thất cao cấp DOYLE</td>\r\n</tr>\r\n<tr>\r\n<td>Sơn lót</td>\r\n<td>1-2 lớp</td>\r\n<td>Sơn lót kháng kiềm ngoại thất cao cấp DOYLE– PRIME .EXT</td>\r\n</tr>\r\n<tr>\r\n<td>Sơn phủ</td>\r\n<td>02 lớp</td>\r\n<td>– Sơn siêu bong  ngoại thất DOYLE– ALL IN ONE</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p style=\"text-align: center;\"><span style=\"color: #ff0000;\"><strong>CÔNG TY CỔ PHẦN DẦU KHÍ QUỐC TẾ NAM VIỆT</strong></span></p>\r\n<p style=\"text-align: center;\"><strong>Địa chỉ : Nhóm 7 - Đông Viên - Xã Đông Quang - Ba Vì - Hà Nội</strong></p>\r\n<p style=\"text-align: center;\"><span style=\"color: #ff0000;\"><strong>Hotline: 0989130086 – 0936403966</strong></span>\r\n<span style=\"color: #0000ff;\">Website: doylecolor.com- Email:dkqtnamviet@gmail.com</span>\r\n<strong>Nhà máy Hà Nội: KCN Biên Giang, Yên Thành, Hà Đông, Hà Nội</strong>\r\nNhà máy Thanh Hóa: QL1, Hoằng Phú, Hoằng Hóa, Thanh Hóa.\r\nNhà máy Nghệ An: QL1, Nghi Liên, TP. Vinh.\r\nNhà máy Đà Nẵng: KĐT Phước Lý, Q. Liên Chiểu, TP Đà Nẵng.\r\nNhà máy Hồ Chí Minh: Số 51, Đ. TX 31, P. Thạnh Xuân, Q 12, TP. HCM\r\nNhà máy Cần Thơ: 254 Hoàng Quốc Việt, Phường An Bình, Q. Ninh Kiều, TP Cần Thơ.</p>', 'SƠN SIÊU BÓNG NGOẠI THẤT ALL IN ONE', '', 'publish', 'open', 'closed', '', 'son-sieu-bong-ngoai-one', '', '', '2018-10-02 16:00:05', '2018-10-02 09:00:05', '', 0, 'http://doylecolor.com/?post_type=product&#038;p=189', 0, 'product', '', 0),
