(194, 1, '2017-11-01 16:37:08', '2017-11-01 09:37:08', 'NỘI DUNG CHI TIẾT\r\n<div class=\"entry-content\">\r\n<table style=\"width: 796px;\">\r\n<tbody>\r\n<tr>\r\n<td style=\"width: 454px;\"><strong> </strong><strong>Mô tả sản phẩm:</strong>\r\n\r\nDOYLE – IN FLAT  sơn bóng nội thất cao cấp, là loại sơn được làm từ nhựa tổng hợp Acrylic. Đây là loại sơn có khả năng bám dính cao, chống phồng rộp, chống bong tróc giữa sơn và bề mặt tường rất cao, giúp che lấp các khe nứt nhỏ như những vết chân chim, màu sắc phong phú,…\r\n\r\nĐóng gói: 1kg, 5kg, 20kg/thùng (Khối lượng cả bao bì).</td>\r\n<td style=\"width: 328px;\"><img class=\"aligncenter size-large wp-image-195\" src=\"http://doylecolor.com/wp-content/uploads/2017/11/DOYLE-DO6.5NO-1024x778.jpg\" alt=\"\" width=\"1000\" height=\"760\" /></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<strong>Tính năng vượt trội:</strong>\r\n<ol>\r\n 	<li>Có khả năng bám dính tốt,… bảo vệ lớp sơn phủ hoàn thiện luôn tươi mới và bền đẹp với thời gian. <span style=\"color: #ffffff;\"><a href=\"https://www.webtretho.com/forum/f3156/review-hoc-ke-toan-thuc-hanh-o-dau-tot-2490805/\"><span style=\"color: #ffffff;\">địa chỉ học</span> <span style=\"color: #ffffff;\">kế toán thực hành</span></a></span></li>\r\n 	<li>Có che lấp các khe nứt nhỏ, trà rửa lau chùi hiệu quả,…cho bề mặt sơn phủ luôn sáng bóng.</li>\r\n 	<li>Đã được nhiệt đới hóa phù hợp với điều kiện thời tiết khắc nghiệt của Việt Nam.</li>\r\n 	<li>Độ phủ cao – tiết kiệm chi phí trên từng m<sup>2</sup>.</li>\r\n 	<li>Thi công dễ dàng, thân thiện với môi trường.</li>\r\n 	<li>Phù hợp TCVN: 6934-2001</li>\r\n</ol>\r\n<strong>Thông số kỹ thuật:</strong>\r\n<table width=\"725\">\r\n<tbody>\r\n<tr>\r\n<td>Loại keo</td>\r\n<td>Độ mịn</td>\r\n<td>Độ phủ lý thuyết</td>\r\n<td>Độ nhớt</td>\r\n<td>Ngâm trong nước &amp; DD Ca(OH)2 bão hòa</td>\r\n</tr>\r\n<tr>\r\n<td>Acrylic</td>\r\n<td>25µm</td>\r\n<td>10-12m<sup>2</sup>/1lớp /1kg</td>\r\n<td>99KU±0.5%</td>\r\n<td>Màng phủ bền</td>\r\n</tr>\r\n<tr>\r\n<td>Tỷ trọng</td>\r\n<td>Hàm lượng chất rắn không bay hơi</td>\r\n<td>Thời gian khô bề mặt</td>\r\n<td>Thời gian khô hoàn toàn</td>\r\n<td>Pha loãng</td>\r\n</tr>\r\n<tr>\r\n<td>1.24</td>\r\n<td>45.7</td>\r\n<td>30 phút</td>\r\n<td>2 giờ</td>\r\n<td>Tối đa 10% nước sạc</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<strong>Thi công:</strong>\r\n<ol>\r\n 	<li>Chuẩn bị bề mặt: Bề mặt sơn phải được làm sạch, khô ráo, độ ẩm không quá 15%, không bị bẩn, không dính hóa chất, dầu mỡ, bị rỉ sắt, bong tróc, sử dụng chất tẩy rửa để làm sạch nếu cần. Sử dụng giấy nhám mịn để tạo bề mặt cần sơn được bóng loáng. Những vết nứt và lỗ thủng cần được vá lại trước khi thi công.</li>\r\n 	<li>Khuấy đều thùng sơn trước khi sử dụng. Dùng Runo, cọ lăn hay Máy phun sơn để thi công.</li>\r\n 	<li>Đổ sơn còn thừa vào thùng, làm sạch những nơi bị dính sơn bằng nước sạch ngay khi sơn xong.</li>\r\n</ol>\r\n<strong>Hệ thống sơn đề nghị:</strong>\r\n<table width=\"711\">\r\n<tbody>\r\n<tr>\r\n<td>Bột trét tường</td>\r\n<td>1-2 lớp</td>\r\n<td> Bột bả cao cấp DOYLE</td>\r\n</tr>\r\n<tr>\r\n<td>Sơn lót</td>\r\n<td>1-2 lớp</td>\r\n<td>Sơn lót kháng kiềm cao cấp DOYLE – PRIME IN</td>\r\n</tr>\r\n<tr>\r\n<td>Sơn phủ</td>\r\n<td>02 lớp</td>\r\n<td>– Sơn bóng nội thất DOYLE – IN FLAT</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p style=\"text-align: center;\"><span style=\"color: #ff0000;\"><strong>CÔNG TY CỔ PHẦN DẦU KHÍ QUỐC TẾ NAM VIỆT</strong></span></p>\r\n<p style=\"text-align: center;\"><strong>Địa chỉ : Nhóm 7 - Đông Viên - Xã Đông Quang - Ba Vì - Hà Nội</strong></p>\r\n<p style=\"text-align: center;\"><span style=\"color: #ff0000;\"><strong>Hotline: 0989130086 – 0936403966</strong></span>\r\n<span style=\"color: #0000ff;\">Website: doylecolor.com- Email:dkqtnamviet@gmail.com</span>\r\n<strong>Nhà máy Hà Nội: KCN Biên Giang, Yên Thành, Hà Đông, Hà Nội</strong>\r\nNhà máy Thanh Hóa: QL1, Hoằng Phú, Hoằng Hóa, Thanh Hóa.\r\nNhà máy Nghệ An: QL1, Nghi Liên, TP. Vinh.\r\nNhà máy Đà Nẵng: KĐT Phước Lý, Q. Liên Chiểu, TP Đà Nẵng.\r\nNhà máy Hồ Chí Minh: Số 51, Đ. TX 31, P. Thạnh Xuân, Q 12, TP. HCM\r\nNhà máy Cần Thơ: 254 Hoàng Quốc Việt, Phường An Bình, Q. Ninh Kiều, TP Cần Thơ.</p>\r\n\r\n</div>', 'SƠN BÓNG NỘI THẤT IN FLAT', '', 'publish', 'open', 'closed', '', 'son-bong-noi-flat', '', '', '2018-10-24 16:49:54', '2018-10-24 09:49:54', '', 0, 'http://doylecolor.com/?post_type=product&#038;p=194', 0, 'product', '', 0),
