(205, 1, '2017-11-02 09:06:47', '2017-11-02 02:06:47', '<h1><strong>Công ty Cổ phần Nam Việt.Group - Nam Việt Group - Hãng Sơn Ronin</strong></h1>\r\n<h2><strong>LỜI GIỚI THIỆU</strong><strong> </strong></h2>\r\nCông ty chúng tôi xác định Việt Nam là thị trường giàu tiềm năng và là nền tảng để phát triển mặt hàng sơn nước. Trong năm 2006,<strong> Công ty Cổ phần Nam Việt.Group - Nam Việt Group</strong> đã đầu tư dây chuyền công nghệ hiện đại với công suất sản xuất 2 triệu lít sơn và hàng ngàn tấn bột trét mỗi năm, kinh phí đầu tư trên 2triệu USD tại Khu Công Nghiệp Thanh Oai, Hà Nội đây là một trong những nhà máy sản xuất sơn lớn nhất Việt Nam hiện nay.\r\n\r\nVề nguyên liệu sản xuất, áp dụng nguyên tắc kiểm tra đầu vào nghiêm ngặt, hầu hết nguyên liệu sản xuất <strong>sơn DOYLE </strong>nhập khẩu từ những tập đoàn hóa chất nổi tiếng như: Degussa (Mỹ), Eliokem (Pháp), Dow Chemical (Mỹ), Rohm &amp; Hass (Mỹ), Cray Valley (Maylaysia), Nuplex (Australia)...\r\n\r\nVề mặt kỹ thuật, với dây chuyền công nghệ hiện đại cùng đội ngũ chuyên gia kỹ thuật giàu kinh nghiệm tiến hành nghiên cứu, phát triển sản phẩm, song song đó công ty đã tiến hành hợp tác kỹ thuật, mua các phát minh mới từ nước ngoài, chủ yếu là Nhật và châu Á kết hợp với nghiên cứu, cải tiến nhằm đưa ra sản phẩm chất lượng cao, phù hợp với môi trường khí hậu Việt Nam.\r\n\r\nHơn nữa, việc tích hợp hệ thống quản lý môi trường theo tiêu chuẩn ISO 14001:2004, và hệ thống quản lý chất lượng theo tiêu chuẩn ISO 9001:2008, được công nhận bởi Tổ chức của Nhật, đã khẳng định rằng <strong>Công ty Cổ phần Nam Việt.Group - Nam Việt Group</strong> đã đề ra chính sách phù hợp và cũng định hướng cho việc cải tiến liên tục các sản phẩm, đáp ứng nhu cầu càng cao về sản phẩm sơn trang trí của thị trường trong nước.\r\n\r\nChính vì thế, <strong>sơn DOYLE</strong> do <strong>Công ty Cổ phần Nam Việt.Group - Nam Việt Group </strong>sản xuất luôn được giới chuyên môn, kiến trúc sư, kỹ sư, thầu thợ chuyên nghiệp sử dụng và đánh giá cao. Ngoài ra Công ty  đã và đang rất thành công và đầu tư phát triển trong việc tham gia đấu thầu thi công và cung cấp vật liệu cho các dự án lớn trong cả    nước.\r\n<strong>Công ty Cổ phần Nam Việt.Group - Nam Việt Group</strong> luôn phấn đấu là địa chỉ đáng tin cậy của các nhà thầu xây dựng tại Việt Nam và mong muốn nhận được sự hợp tác của bạn hàng trong nước và quốc tế.\r\n\r\nTrân trọng cảm ơn!\r\n\r\n<strong>Công ty Cổ phần Nam Việt.Group - Nam Việt Group</strong>', 'Giới thiệu', '', 'inherit', 'closed', 'closed', '', '2-revision-v1', '', '', '2017-11-02 09:06:47', '2017-11-02 02:06:47', '', 2, 'http://doylecolor.com/2-revision-v1/', 0, 'revision', '', 0),
(206, 1, '2017-11-07 10:52:47', '2017-11-07 03:52:47', '&nbsp;\n\n<img class=\"aligncenter wp-image-176 size-large\" src=\"http://doylecolor.com/wp-content/uploads/2017/11/DOYLE-DO6.77-1024x778.jpg\" alt=\"\" width=\"1000\" height=\"760\" />\n<p style=\"text-align: center;\"><span style=\"color: #ff0000;\"><strong>CÔNG TY CỔ PHẦN DẦU KHÍ QUỐC TẾ NAM VIỆT</strong></span></p>\n<p style=\"text-align: center;\"><strong>Địa chỉ : Nhóm 7 - Đông Viên - Xã Đông Quang - Ba Vì - Hà Nội</strong>\n<span style=\"color: #0000ff;\">Website: doylecolor.com- Email:dkqtnamviet@gmail.com</span>\n<strong>Nhà máy Hà Nội: KCN Biên Giang, Yên Thành, Hà Đông, Hà Nội</strong>\nNhà máy Thanh Hóa: QL1, Hoằng Phú, Hoằng Hóa, Thanh Hóa.\nNhà máy Nghệ An: QL1, Nghi Liên, TP. Vinh.\nNhà máy Đà Nẵng: KĐT Phước Lý, Q. Liên Chiểu, TP Đà Nẵng.\nNhà máy Hồ Chí Minh: Số 51, Đ. TX 31, P. Thạnh Xuân, Q 12, TP. HCM\nNhà máy Cần Thơ: 254 Hoàng Quốc Việt, Phường An Bình, Q. Ninh Kiều, TP Cần Thơ.</p>', 'SƠN CHỐNG THẤM MÀU HIỆU QUẢ', '', 'inherit', 'closed', 'closed', '', '175-autosave-v1', '', '', '2017-11-07 10:52:47', '2017-11-07 03:52:47', '', 175, 'http://doylecolor.com/175-autosave-v1/', 0, 'revision', '', 0),
(207, 1, '2017-11-02 10:51:43', '2017-11-02 03:51:43', '<strong><em>1. Mô tả:</em></strong>\n\nDOYLE DO6.7 là hệ sơn chống thấm dạng lỏng, hệ nước, nhũ tương màu trắng sữa.\n\nDOYLE DO6.7 là loại sơn acrylic biến tính tương thích với hệ trộn xi măng. Khi phủ lên lớp bề mặt bên trong hoặc bên ngoài các công trình xây dựng, sơn tạo thành lớp màng cứng kín nước, xong bề mặt vẫn thoát hơi nước một cách dễ dàng.\n\n<img class=\"aligncenter wp-image-178 size-large\" src=\"http://doylecolor.com/wp-content/uploads/2017/11/DOYLE-DO6.7-1024x778.jpg\" alt=\"\" width=\"1000\" height=\"760\" />\n\n&nbsp;\n\n<strong><em>2. Công dụng:</em></strong>\n<ul>\n 	<li>DOYLE là loại sơn chống thấm được sử dụng tốt nhất để ngăn thấm nước cho các bề mặt vữa chát, xi măng bê tông như: tường đứng, trần nhà, sàn nhà vệ sinh, bể nước… Với các đặc tính nổi bật như sau:\n<ul>\n 	<li>Chống thấm tuyệt đối cho các bề mặt ứng dụng.</li>\n 	<li>Độ liên kết và kết dính tuyệt hảo.</li>\n 	<li>Giảm tối đa sự co ngót thể tích trong quá trình đóng rắn xi măng.</li>\n 	<li>Tăng tính co dãn, độ đàn hồi cho vữa xi măng – cát.</li>\n 	<li>Tăng tính kháng ăn mòn hoá học, kháng mài mòn cơ học. Ổn định về mặt hoá, lý tính.</li>\n 	<li>Không cháy, không chứa chì và thuỷ ngân, không gây độc hại cho người sử dụng và người thi công, nên có thể sử dụng cho các lớp vữa chống thấm tiếp xúc trực tiếp với nước sinh hoạt.</li>\n</ul>\n</li>\n</ul>\n<strong><em>3. Thông số kỹ thuật:</em></strong>\n\n– Nguồn gốc hoá học: keo chống thấm acrylic biến tính và phụ gia.\n\nKhối lượng riêng: 1.25 ± 0.05 (g/ml, @ 25 oC); pH = 8 – 10.\n<ul>\n 	<li>Điều kiện lưu trữ: Bảo quản nơi khô ráo, thoáng mát, tránh tiếp xúc trực tiếp với ánh nắng. Đậy kín khi sử dụng còn dư và chưa trộn với xi măng.</li>\n 	<li>Thời gian lưu trữ: 12 tháng kể từ ngày sản xuất (trong thùng nguyên, bảo quản đúng).</li>\n 	<li>Đóng gói: 1kg, 5kg, 20kg/thùng <em>(Khối lượng cả bao bì)</em></li>\n</ul>\n<strong><em>4. Thi công:</em></strong>\n<ul>\n 	<li>Chuẩn bị bề mặt: Bề mặt bê tông phải được làm ẩm và làm sạch, ở điều kiện không dính dầu mỡ, bụi xi măng và các tạp chất khác. Nếu bề mặt có độ nhám thấp cần phải tạo nhám băng các biện pháp cơ học thích hợp trước khi ứng dụng sản phẩm.</li>\n 	<li>Thi công: Chuẩn bị sơn chống thấm DO6.7 – DOYLE và xi măng Poorter mác cao (từ 400 trở lên) theo tỷ lệ 1:1. Pha xi măng với một lượng nước sạch thành dạng sền sệt, sau đó pha với DO6.7 – DOYLE và khuấy lại thật đều. Dùng chổi cọ hoặc rulô phủ 2-3 lớp hỗn hợp trên lên bề mặt sử dụng, mỗi lớp sơn cách nhau 06 – 08 giờ. DO6.7 – DOYLE sau khi sơn xong từ 1-2 ngày thì mới tiến hành sơn phủ các lớp sơn khác lên. DO6.7 – DOYLE sẽ cứng lại sau 7 ngày.</li>\n 	<li>Chú ý: Nếu đã trộn DO6.7 – DOYLE với xi măng thì phải sử dụng trong vòng 1 giờ. Vì sau thời gian đó sản phẩm sẽ bị đông cứng. Sử dụng đến đâu thì trộn xi măng đến đó.</li>\n 	<li>Định mức: 3.0 – 3.5 m<sup>2 </sup>/1kg, tuỳ thuộc bề mặt vật liệu</li>\n 	<li>Vệ sinh dụng cụ: Rửa bằng xà bông và nước sạch.</li>\n</ul>\n<p style=\"text-align: center;\"><strong>Phòng điều phối sơn Doyle - Tập đoàn Nam Việt</strong></p>\n<p style=\"text-align: center;\"><strong>VPGD: Số 12C, km 14/500, QL 6, Quận Hà Đông, TP Hà Nội.</strong></p>\n<p style=\"text-align: center;\"><strong>Tel: 0936 370 566 - Hotline: 0964 893 088</strong> Website: <a href=\"http://doylecolor.com\">http://campercolor.com</a></p>\n<p style=\"text-align: center;\">Gmail: pdp.doyle@gmail.com</p>\n<p style=\"text-align: center;\">Nhà máy miền Bắc: KCN Biên Giang, Yên Thành, Q. Hà Đông, TP. Hà Nội</p>\n<p style=\"text-align: center;\">Nhà máy miền Trung: KĐT Phước Lý, Q. Liên Chiểu, TP. Đà Nẵng</p>\n<p style=\"text-align: center;\">Nhà máy miền Nam: KCN số 51, đường TX31, phường Thạnh Xuân, Q.12,TP. HCM</p>', 'DOYLE DO6.7 – SƠN CHỐNG THẤM ĐA NĂNG', '', 'inherit', 'closed', 'closed', '', '177-autosave-v1', '', '', '2017-11-02 10:51:43', '2017-11-02 03:51:43', '', 177, 'http://doylecolor.com/177-autosave-v1/', 0, 'revision', '', 0),
(208, 1, '2017-11-02 10:53:20', '2017-11-02 03:53:20', '<strong>Mô tả sản phẩm:</strong>\n\nDOYLE – PRIMER INT là sơn lót kháng kiềm nội thất cao cấp, là loại sơn được làm từ nhựa tổng hợp Acrylic. Đây là loại sơn có khả năng kháng kiềm cao, chống phồng rộp, chống bong tróc giữa sơn và bề mặt tường rất cao, có khả năng đàn hồi, giúp che lấp các khe nứt nhỏ như những vết chân chim.\n\n<img class=\"aligncenter size-large wp-image-180\" src=\"http://doylecolor.com/wp-content/uploads/2017/11/DOYLE-DO6.6NO-1024x778.jpg\" alt=\"\" width=\"1000\" height=\"760\" />\n\n&nbsp;\n\n<strong>Tính năng vượt trội:</strong>\n<ol>\n 	<li>Có độ chống kiềm cao, khả năng bám dính tốt,… bảo vệ lớp sơn phủ hoàn thiện luôn tươi mới và bền đẹp với thời gian.</li>\n 	<li>Có khả năng đàn hồi và che lấp các khe nứt nhỏ,… cho bề mặt sơn phủ luôn sáng bóng.</li>\n 	<li>Đã được nhiệt đới hóa phù hợp với điều kiện thời tiết khắc nghiệt của Việt Nam.</li>\n 	<li>Độ phủ cao – tiết kiệm chi phí trên từng m<sup>2</sup>.</li>\n 	<li>Thi công dễ dàng, thân thiện với môi trường.</li>\n 	<li>Phù hợp TCVN: 6934-2001</li>\n</ol>\n<strong>Thông số kỹ thuật:</strong>\n<table width=\"705\">\n<tbody>\n<tr>\n<td>Loại keo</td>\n<td>Độ mịn</td>\n<td>Độ phủ lý thuyết</td>\n<td>Độ nhớt</td>\n<td>Ngâm trong nước &amp; DD Ca(OH)2 bão hòa</td>\n</tr>\n<tr>\n<td>Acrylic</td>\n<td>30µm</td>\n<td>10-12m<sup>2</sup>/1lớp /1kg</td>\n<td>99KU±0.5%</td>\n<td>Màng phủ bền</td>\n</tr>\n<tr>\n<td>Tỷ trọng</td>\n<td>Hàm lượng chất rắn không bay hơi</td>\n<td>Thời gian khô bề mặt</td>\n<td>Thời gian khô hoàn toàn</td>\n<td>Pha loãng</td>\n</tr>\n<tr>\n<td>1.31</td>\n<td>48.8</td>\n<td>30 phút</td>\n<td>2 giờ</td>\n<td>Tối đa 10% nước sạch</td>\n</tr>\n</tbody>\n</table>\n<strong> </strong>\n\n<strong>Thi công:</strong>\n<ol>\n 	<li>Chuẩn bị bề mặt: Bề mặt sơn phải được làm sạch, khô ráo, độ ẩm không quá 15%, không bị bẩn, không dính hóa chất, dầu mỡ, bị rỉ sắt, bong tróc, sử dụng chất tẩy rửa để làm sạch nếu cần. Sử dụng giấy nhám mịn để tạo bề mặt cần sơn được bóng loáng. Những vết nứt và lỗ thủng cần được vá lại trước khi thi công.</li>\n 	<li>Khuấy đều thùng sơn trước khi sử dụng. Dùng Runo, cọ lăn hay Máy phun sơn để thi công.</li>\n 	<li>Đổ sơn còn thừa vào thùng, làm sạch những nơi bị dính sơn bằng nước sạch ngay khi sơn xong.</li>\n</ol>\n<strong>Hệ thống sơn đề nghị:</strong>\n<table width=\"717\">\n<tbody>\n<tr>\n<td>Bột trét tường</td>\n<td>1-2 lớp</td>\n<td> Bột bả cao cấp DOYLE</td>\n</tr>\n<tr>\n<td>Sơn lót</td>\n<td>1-2 lớp</td>\n<td>Sơn lót kháng kiềm cao cấp DOYLE – PRIME. INT</td>\n</tr>\n<tr>\n<td rowspan=\"3\">Sơn phủ</td>\n<td rowspan=\"3\">2 lớp</td>\n<td>– Sơn phủ mờ DOYLE – IN FAMI</td>\n</tr>\n<tr>\n<td>– Sơn phủ bóng DOYLE– IN FLAT</td>\n</tr>\n<tr>\n<td>– Sơn siêu bóng DOYLE – GLOSS ONE</td>\n</tr>\n</tbody>\n</table>\n<p style=\"text-align: center;\"><strong>Phòng điều phối sơn Doyle - Tập đoàn Nam Việt</strong></p>\n<p style=\"text-align: center;\"><strong><span style=\"color: #0000ff;\">VPGD: Số 12C, km 14/500, QL 6, Quận Hà Đông, TP Hà Nội.</span></strong></p>\n<p style=\"text-align: center;\"><span style=\"color: #ff0000;\"><strong>Tel: 0936 370 566 - Hotline: 0964 893 088</strong></span> <span style=\"color: #0000ff;\">Website: http://doylecolor.com</span></p>\n<p style=\"text-align: center;\">Gmail: pdp.doyle@gmail.com</p>\n<p style=\"text-align: center;\">Nhà máy miền Bắc: KCN Biên Giang, Yên Thành, Q. Hà Đông, TP. Hà Nội</p>\n<p style=\"text-align: center;\">Nhà máy miền Trung: KĐT Phước Lý, Q. Liên Chiểu, TP. Đà Nẵng</p>\n<p style=\"text-align: center;\">Nhà máy miền Nam: KCN số 51, đường TX31, phường Thạnh Xuân, Q.12,TP. HCM</p>', 'SƠN LÓT KHÁNG KIỀM NỘI THẤT CAO CẤP', '', 'inherit', 'closed', 'closed', '', '179-autosave-v1', '', '', '2017-11-02 10:53:20', '2017-11-02 03:53:20', '', 179, 'http://doylecolor.com/179-autosave-v1/', 0, 'revision', '', 0),
